Да Алексей ВР, а дырочку закрыли мячиками для гольфа;
 а со спутника просто ужасная катастрофа;
При том, что такое громадное количество не могло вылиться в одночасье, где были охранники, сотрудники, ответственные лица, выходит что просто проспали, и узнали об утечке из соцсетей)))
Правильно пусть заплатят из своих толстых карманов и под суд за безалаберность, потому что замазать это одно, а вред экологии не восполним никакими мильярдами

