@Василий Иванов сейчас не найду точно источник,но текст ,кот. в Инстаграм размещала говорит примерно о том же. Масштабы ведь только начинают оценивать.
*Пока неясно, какова причина разлива. Профессор Университета Джорджа Вашингтона Дмитрий Стрелецкий рассказал агентству «Блумберг»: «Причину еще предстоит определить, но вероятно, это было сочетание климатических изменений и факторов, относящихся к инфраструктуре».

Арктический регион очень уязвим, и общий ущерб может оказаться колоссальным. Бывший заместитель руководителя российского природоохранного ведомства «Росприроднадзор» Олег Митволь сказал, что такой аварии в арктической зоне не было никогда. По словам Митволя, чтобы ликвидировать последствия загрязнения, понадобится от пяти до 10 лет, и эти работы обойдутся в 100 миллиардов рублей (1,5 миллиарда долларов)*

